import React from "react";
import "./Header.scss";
const Header = () => {
  return (
    <>
      <header className="header">
        <div className="container">
            <div className="header-content">
                <div>
                    <ul>
                        <li></li>
                    </ul>
                </div>
            </div>
        </div>
      </header>
    </>
  );
};

export default Header;
